at executive team<br>\n","3. Bellabeat marketing analytics team<br>\n"]},{"cell_type":"markdown","id":"3eb00064","metadata":{"papermill":{"duration":0.011446,"end_time":"2024-08-04T14:44:34.517621","exception":false,"start_time":"2024-08-04T14:44:34.506175","status":"completed"},"tags":[]},"source":["# Prepare\n","I dowdloaded and used the dataset which was public in Kaggle. It is open-soured and has only data of 30 users as sample size. This Kaggle dataset contains personal fitness tracker from thirty fitbit users which includes minute-level out put for physical activity, heartrate, and sleep monitoring. All files are structured in CSV. <br>\n","I suppose this data maybe credibility and has low ROCCC because: <br>\n","+ Reliable: in this dataset, you will only see the Id to recognize users without other informations such as age, address,... <br>\n","+ This data is collected by third-party in 2016 which is considered out-dated and no refresh recently."]},{"cell_type":"markdown","id":"126b1b95","metadata":{"papermill":{"duration":0.011302,"end_time":"2024-08-04T14:44:34.540159","exception":false,"start_time":"2024-08-04T14:44:34.528857","status":"completed"},"tags":[]},"source":["# Process\n","During this phase, I will: \n","* Combine data into frame\n","* Add columns: day of week and month\n","* Caculate the average of values \n","* Classify user groups\n","* Remove not needed columns"]},{"cell_type":"markdown","id":"868d4c39","metadata":{"papermill":{"duration":0.011149,"end_time":"2024-08-04T14:44:34.562308","exception":false,"start_time":"2024-08-04T14:44:34.551159","status":"completed"},"tags":[]},"source":["Fristly, I will install nesscessary packages as code below"]},{"cell_type":"code","execution_count":1,"id":"10706ac6","metadata":{"execution":{"iopub.execute_input":"2024-08-04T14:44:34.588546Z","iopub.status.busy":"2024-08-04T14:44:34.586451Z","iopub.status.idle":"2024-08-04T14:45:30.46022Z","shell.execute_reply":"2024-08-04T14:45:30.458444Z"},"papermill":{